def update_board(attempt,guess,letters,past,secret,win,total,turns):
    
    board.fill(white)
    
    for i in range(6):
        for j in range(5):
            tile = pygame.Rect(2+j*50,2+i*50,46,46)
            pygame.draw.rect(board,black,tile,2)
    
    if guess:
        for i,c in enumerate(list(guess)):
            tile_char = tile_font.render(c,1,black)
            char_tile = tile_char.get_rect()
            char_tile.center = (25+i*50, 25+attempt*50)
            board.blit(tile_char, char_tile)
            
    if past:
        for i,w in enumerate(past):
            for j,c in enumerate(list(w)):
                if c not in secret:
                    color = grey
                elif c == secret[j]:
                    color = green
                else:
                    color = yellow
                tile_char = tile_font.render(c,1,color)
                char_tile = tile_char.get_rect()
                char_tile.center = (25+j*50, 25+i*50)
                board.blit(tile_char, char_tile)
    
    for i,c in enumerate(list(row1)):
        keyboard_char = keyboard_font.render(c,1,letters[c])
        char_tile = keyboard_char.get_rect()
        char_tile.center = (18+i*24, 320)
        board.blit(keyboard_char, char_tile)
        
    for i,c in enumerate(list(row2)):
        keyboard_char = keyboard_font.render(c,1,letters[c])
        char_tile = keyboard_char.get_rect()
        char_tile.center = (26+i*24, 350)
        board.blit(keyboard_char, char_tile)
    
    for i,c in enumerate(list(row3)):
        keyboard_char = keyboard_font.render(c,1,letters[c])
        char_tile = keyboard_char.get_rect()
        char_tile.center = (50+i*24, 380)
        board.blit(keyboard_char, char_tile)
    
    del_button = special_font.render(' del ',1,black)
    del_tile = del_button.get_rect()
    del_tile.center = (25,380)
    pygame.draw.rect(board,black,del_tile,1)
    board.blit(del_button, del_tile)
    
    ent_button = special_font.render(' ent ',1,black)
    ent_tile = ent_button.get_rect()
    ent_tile.center = (225,380)
    pygame.draw.rect(board,black,ent_tile,1)
    board.blit(ent_button, ent_tile)
    
    if total:
        stats = f'{win}/{total} ({win/total:.2%})   avg: {sum(turns)/len(turns):.2f}'
        if total > 999:
            if win > 999:
                stats = f'999+/999+ ({win/total:.2%})   avg: {sum(turns)/len(turns):.2f}'
            else:
                stats = f'{win}/999+ ({win/total:.2%})   avg: {sum(turns)/len(turns):.2f}'
        stats_char = stats_font.render(stats,1,grey)
        stats_tile = stats_char.get_rect()
        stats_tile.center = (125, 420)
        board.blit(stats_char, stats_tile)
    
    pygame.display.update()

def update_letters(guess,secret,letters):
    for i,c in enumerate(list(guess)):
        if letters[c] != green:
            if c not in secret:
                letters[c] = grey
            elif c == secret[i]:
                letters[c] = green
            else:
                letters[c] = yellow
    return letters
    
def main(win,total,turns):
    
    run = True
    
    letters = {}
    for c in alphabet:
        letters[c] = black
    
    secret = random.choice(puzzle)
    
    attempt = 0
    guess = ''
    past = []
    
    while run:
        
        pygame.time.Clock().tick(60)

        for event in pygame.event.get():
            if event.type == pygame.QUIT:
                run = False
                pygame.quit()
                sys.exit()
            
            if event.type == pygame.KEYDOWN:
                if (event.unicode in 'ABCDEFGHIJKLMNOPQRSTUVWXYZ' or event.unicode in 'ABCDEFGHIJKLMNOPQRSTUVWXYZ'.lower()) and len(guess) < 5:
                    guess += event.unicode.upper()
                if event.key == pygame.K_BACKSPACE and len(guess) > 0:
                    guess = guess[:-1]
                if event.key == pygame.K_RETURN and len(guess) == 5:
                    if guess in allowed:
                        past.append(guess)
                        attempt += 1
                        if guess == secret or attempt > 5:
                            run = False
                        else:
                            letters = update_letters(guess,secret,letters)
                        guess = ''
            
            if event.type == pygame.MOUSEBUTTONDOWN:
                x,y = pygame.mouse.get_pos()
                if y in range(320-14,320+15):
                    i = (x-6)//24
                    if i in range(len(row1)):
                        guess += row1[i]
                elif y in range(350-14,350+15):
                    i = (x-14)//24
                    if i in range(len(row2)):
                        guess += row2[i]
                elif y in range(380-14,380+15):
                    if x in range(25-15,25+16):
                        if len(guess) > 0:
                            guess = guess[:-1]
                    elif x in range(225-15,225+16):
                        if len(guess) == 5:
                            if guess in allowed:
                                past.append(guess)
                                attempt += 1
                                if guess == secret or attempt > 5:
                                    run = False
                                else:
                                    letters = update_letters(guess,secret,letters)
                                guess = ''
                    else:
                        i = (x-38)//24
                        if i in range(len(row3)):
                            guess += row3[i]
                    
        update_board(attempt,guess,letters,past,secret,win,total,turns)
    
    
    pygame.draw.rect(board,white,pygame.Rect(0,300,250,100))
    if past[-1] == secret:
        message = keyboard_font.render('Congrats!',1,green)
        win += 1
    else:
        message = keyboard_font.render(secret,1,green)
    total += 1
    turns.append(len(past))
    message_tile = message.get_rect()
    message_tile.center = (125, 320)
    board.blit(message, message_tile)
    new = keyboard_font.render('New puzzle in',1,black)
    new_tile = new.get_rect()
    new_tile.center = (125, 350)
    board.blit(new, new_tile)
    for i in range(5,0,-1):
        xseconds = keyboard_font.render(f'{i} seconds...',1,black)
        xseconds_tile = xseconds.get_rect()
        xseconds_tile.center = (125, 380)
        board.blit(xseconds, xseconds_tile)
        pygame.display.update()
        pygame.time.delay(1000)
        pygame.draw.rect(board,white,pygame.Rect(0,365,250,45))
    
    main(win,total,turns)
    
    
if __name__ == "__main__":
    main(0,0,[])